import styled from "styled-components";

export const Navbar = styled.nav`
  background-image: url("https://images.unsplash.com/photo-1545873509-33e944ca7655?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1352&q=80");
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  color: black;
  height: 5vh;
  margin-bottom: 30px;
  padding-bottom: 10px;
  padding-left: 10px;
  top: 0;

  h2 {
    font-family: "Lobster", cursive;
  }

  @media (max-width: 767px) {
    text-align: center;
  }
`;
